0%;" data-v-2a510020><img src="https://api.level80.by/wp-content/uploads/2022/05/level80-чёрные-майки-scaled.jpg" data-src="https://api.level80.by/wp-content/uploads/2022/05/level80-чёрные-майки-scaled.jpg" data-srcset="https://api.level80.by/wp-content/uploads/2022/05/level80-чёрные-майки-150x150.jpg 150w 150h, https://api.level80.by/wp-content/uploads/2022/05/level80-чёрные-майки-200x300.jpg 200w 300h, https://api.level80.by/wp-content/uploads/2022/05/level80-чёрные-майки-768x1154.jpg 640w 962h, https://api.level80.by/wp-content/uploads/2022/05/level80-чёрные-майки-681x1024.jpg 640w 962h, https://api.level80.by/wp-content/uploads/2022/05/level80-чёрные-майки-1022x1536.jpg 1022w 1536h, https://api.level80.by/wp-content/uploads/2022/05/level80-чёрные-майки-1363x2048.jpg 1363w 2048h, https://api.level80.by/wp-content/uploads/2022/05/level80-чёрные-майки-scaled.jpg 1703w 2560h" data-aspectratio="0.75" sizes="" alt="level80-chjornye-majki" class="base-image base-image--cover" style="object-position:50% 50%;" data-v-2a510020></picture></div></div></div><div class="about-us__content" data-v-6aa91818 data-v-6a0d1b22><div class="about-us__text" data-v-6aa91818 data-v-6a0d1b22><p>Нас зовут Катерина Ковалёва и Кирилл Скорынин. В 2012 году мы основали LEVEL80 | architects: сперва мы успешно реализовали несколько совместных проектов, после чего решили создать компанию, в которой будем заниматься любимым делом.</p>
                                    </div><div class="about-us__quote" data-v-6aa91818 data-v-6a0d1b22><blockquote class="quote" data-v-8d380a0c data-v-6a0d1b22><div class="quote__text" data-v-8d380a0c>Мы считаем, что правильная среда делает людей счастливее, а продуманный дизайн — это не просто интересная форма или красивая упаковка, а инструмент, который создает положительные эмоции и задает сценарии поведения в обществе.</div><div class="quote__cite-container" data-v-8d380a0c><cite class="quote__cite" data-v-8d380a0c>Катерина Ковалева</cite></div></blockquote></div><div class="about-us__text about-us__text--overlay" data-v-6aa91818 data-v-6a0d1b22><p>Но не думайте, что мы работаем только по средам. Нам также нравятся вторники и особенно пятницы. То, что мы создаем, будет существовать долго и большое количество людей будут активно с этим взаимодействовать. Мы с воодушевлением принимаем вызов и берем на себя ответственность.</p>
                                        <p>Наша задача — совместно с заказчиками реализовать их даже самые масштабные амбиции, и при этом сохранить качество в деталях.</p>
