,"medium-height":I,medium_large:"https:\u002F\u002Fapi.level80.by\u002Fwp-content\u002Fuploads\u002F2022\u002F07\u002FMU7A1895-768x512.jpg","medium_large-width":c,"medium_large-height":v,large:"https:\u002F\u002Fapi.level80.by\u002Fwp-content\u002Fuploads\u002F2022\u002F07\u002FMU7A1895-1024x683.jpg","large-width":c,"large-height":v,"1536x1536":"https:\u002F\u002Fapi.level80.by\u002Fwp-content\u002Fuploads\u002F2022\u002F07\u002FMU7A1895-1536x1024.jpg","1536x1536-width":m,"1536x1536-height":y,"2048x2048":"https:\u002F\u002Fapi.level80.by\u002Fwp-content\u002Fuploads\u002F2022\u002F07\u002FMU7A1895-2048x1365.jpg","2048x2048-width":n,"2048x2048-height":K}},centerX:L,centerY:L}}],flex:[{acf_fc_layout:"AboutUs",blockName:{en:a,ru:a},whiteText:{en:"\u003Cp\u003EWe are Katerina Kovaliova and Kirill Skorynin. In 2012, we founded LEVEL80 | architects &#8212; after several successful projects in cooperation, we decided to launch a company where we would do what we love.\u003C\u002Fp\u003E\n",ru:"\u003Cp\u003EНас зовут Катерина Ковалёва и Кирилл Скорынин. В 2012 году мы основали LEVEL80 | architects: сперва мы успешно реализовали несколько совместных проектов, после чего решили создать компанию, в которой будем заниматься любимым делом.\u003C\u002Fp\u003E\n"},quote:{en:"We believe that the right environment makes people happier. Considerate design is not just an interesting shape or attractive packaging, but a tool that creates positive emotions and sets scenarios for behavior in the community.",ru:"Мы считаем, что правильная среда делает людей счастливее, а продуманный дизайн — это не просто интересная форма или красивая упаковка, а инструмент, который создает положительные эмоции и задает сценарии поведения в обществе."},cite:{en:"Katerina Kovaliova",ru:"Катерина Ковалева"},grayText:{en:"\u003Cp\u003EWhat we create will exist for a long time, and lots of people will actively interact with it. We eagerly accept the challenge and take the responsibility.\u003C\u002Fp\u003E\n\u003Cp\u003EOur mission is to help our customers fulfill their ambitions, however big, while preserving our quality in the details.\u003C\u002Fp\u003E\n",ru:"\u003Cp\u003EНо не думайте, что мы работаем только по средам. Нам также нравятся вторники и особенно пятницы. То, что мы создаем, будет существовать долго и большое количество людей будут активно с этим взаимодействовать. Мы с воодушевлением принимаем вызов и берем на себя ответственность.\u003C\u002Fp\u003E\n\u003Cp\u003EНаша задача — совместно с заказчиками реализовать их даже самые масштабные амбиции, и при этом сохранить качество в деталях.\u003C\u002Fp\u003E\n"},image:{ID:bu,id:bu,title:"level80 чёрные майки",filename:"level80-чёрные-майки-scaled.jpg",filesize:442717,url:"https:\u002F\u002Fapi.level80.by\u002Fwp-content\u002Fuploads\u002F2022\u002F05\u002Flevel80-чёрные-майки-scaled.jpg",link:"https:\u002F\u002Fapi.level80.by\u002Fabout-us\u002Flevel80-chjornye-majki\u002F",alt:a,author:p,description:a,caption:a,name:"level80-chjornye-majki",status:g,uploaded_to:aB,date:bv,modified:bv,menu_order:f,mime_type:j,type:h,subtype:k,icon:i,width:1703,height:r,sizes:{thumbnail:"https:\u002F\u002Fapi.level80.by\u002Fwp-content\u002Fuploads\u002F2022\u002F05\u002Flevel80-чёрные-майки-150x150.jpg","thumbnail-width":b,"thumbnail-height":b,medium:"https:\u002F\u002Fapi.level80.by\u002Fwp-content\u002Fuploads\u002F2022\u002F05\u002Flevel80-чёрные-майки-200x300.jpg","medium-width":I,"medium-height":l,medium_large:"https:\u002F\u002Fapi.level80.by\u002Fwp-content\u002Fuploads\u002F2022\u002F05\u002Flevel80-чёрные-майки-768x1154.jpg","medium_large-width":c,"medium_large-height":bw,large:"https:\u002F\u002Fapi.level80.by\u002Fwp-content\u002Fuploads\u002F2022\u002F05\u002Flevel80-чёрные-майки-681x1024.jpg","large-width":c,"large-height":bw,"1536x1536":"https:\u002F\u002Fapi.level80.by\u002Fwp-content\u002Fuploads\u002F2022\u002F05\u002Flevel80-чёрные-майки-1022x1536.jpg","1536x1536-width":bx,"1536x1536-height":m,"2048x2048"